import React, { Component } from 'react';
import {Grid} from 'semantic-ui-react';
import './App.css';

class Home extends Component {
  render() {
    return (
      <Grid>
        <Grid.Column width={4} style={{height:'100%', overflow:'auto', backgroundColor:'red'}}>
          <h1>Left Coloum</h1>
        </Grid.Column>
        <Grid.Column width={12}>
          <h1>Right Coloum</h1>
        </Grid.Column>
      </Grid>
    );
  }
}

export default Home;
